resources.string:
Ja ievadīsiet numuru, kas nav ārkārtas numurs, ņemiet vērā:
 • lai izmantotu ārkārtas zvanu, būs jāatbloķē ierīce;
 • zvans var netikt atbildēts.

Tādējādi tiks izdzēsti visi tālruņa iekšējā atmiņā esošie dati, tostarp:


Google konta dati;

sistēmas un lietotņu dati un iestatījumi;

lejupielādētās lietotnes.

Šādi tiks atiestatītas visas preferences, kas saistītas ar:


atspējotām lietotnēm;

atspējotu lietotņu paziņojumiem;

noklusējuma lietojumprogrammām konkrētu darbību veikšanai;

lietotņu fona datu ierobežojumiem;

visiem atļauju ierobežojumiem;

akumulatora lietojuma iestatījumiem.

Jūs nezaudēsiet lietotņu datus.
